import React, { useState } from 'react';
import * as FaIcons from "react-icons/fa";
import * as AiIcons from "react-icons/ai";
import { Link } from 'react-router-dom';
import { SidebarData } from './SidebarData'
import './Navbar.css'
import { IconContext } from 'react-icons'
// import List from '@material-ui/core/List'
// import ListItem from '@material-ui/core/ListItem'
// import ListItemText from '@material-ui/core/ListItemText'
// const useStyles = makeStyles((theme) => ({
//     root: {
//         width: '10%',
//         maxWidth: 30,
//         backgroundColor: theme.palette.background.paper,
//     },
//     nested: {
//         paddingLeft: theme.spacing(4),
//     },
// }));

function Navbar() {
    const [sidebar, setSidebar] = useState(false)
    const showSidebar = () => setSidebar(!sidebar)
    // const [menu, setMenu] = useState(false)
    // const showMenu = () => setMenu(!menu)
    const classes = useStyles();
    const [open, setOpen] = React.useState(true);
    const handleClick = () => {
        setOpen(!open);
    }

    return (
        <>
            <IconContext.Provider value={{ color: 'navy' }}>
                <div className="navbar">
                    <Link to="#" className="menu-bars">
                        <FaIcons.FaBars onClick={showSidebar} />
                    </Link>
                </div>
                <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}>
                    <ul className='nav-menu-items' onClick={showSidebar}>
                        <li className="navbar-toggle">
                            <Link to="#" className='menu-bars'>
                                <AiIcons.AiOutlineClose />
                            </Link>
                        </li>
                        {SidebarData.map((SidebarData, index) => {
                            return (
                                <div>
                                    <li key={index} className={SidebarData.cName}>
                                        <Link to={SidebarData.path}>
                                            {SidebarData.icon}
                                            <span>{SidebarData.title}</span>
                                        </Link>
                                        {/* {Array.isArray(items) ? (
                                            <List>
                                                {items.map((items) => (
                                                    <ListItem key={items.name} button>
                                                        <ListItemText className="sidebar-item-text">
                                                            {items.label}
                                                        </ListItemText>
                                                    </ListItem>
                                                ))}
                                            </List>
                                        ) : null} */}
                                        {/* {SidebarData.icon1}
                                        <span>{SidebarData.name}</span> */}
                                        {/* {showMenu ? (<div></div>) : (null)} */}
                                    </li>
                                    <li key={index} className={SidebarData.cName}>
                                        {SidebarData.icon}
                                        <span>{SidebarData.name}</span>
                                    </li>
                                </div>
                            )
                        })}
                    </ul>
                    {/* {open ? <ExpandLess /> : <ExpandMore />} */}
                </nav>
            </IconContext.Provider>
        </>
    );
}

export default Navbar;
